          <div class="flex justify-between">
            <label for="email" class="inline-block mb-2 text-sm">Email</label>
            <div class="text-error text-[#FF6D6D] text-sm" v-if="error.email">{{ error.email }}</div>
          </div>
          <Input type="email" id="email" placeholder="Enter your email.." v-model="form.email" autofocus="true" :error="error.email" />
        </div>
        <div class="form-group mb-10">
          <div class="flex justify-between">
            <label for="pw" class="inline-block mb-2 text-sm">Password</label>
            <div class="text-error text-[#FF6D6D] text-sm" v-if="error.password">{{ error.password }}</div>
          </div>
          <Input type="password" id="pw" placeholder="Enter your password.." v-model="form.password" :error="error.password"/>
        </div>
        <Button 
          type="submit"
          @click="login"
        >
        Login
        </Button>
      </form>
    </div>
  </section>
</template>

<script>
import Input from '@/components/Input.vue'
import Button from '@/components/Button.vue'

export default {
  name: 'Login',
  components: {Input, Button},
  data() {
    return {
      form: {
        email: '',
        password: ''
      },
      error: {
        email: '',
        password: ''
      },
      invalid: false
    };
  },
  methods: {
    login() {
      // make validation for valid email with regex
      const emailRegex = /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;

      if (!this.form.email.trim()) {
        this.error.email = 'Email is required!';
      } else {
        if (!emailRegex.test(this.form.email)) {
          this.error.email = 'Email is not valid!';
        } else {
          this.error.email = '';
        }
      }

      // check if password is not empty
      if (!this.form.password.trim()) {
        this.error.password = 'Password is required!'
      } else {
        this.error.password = ''
      }

      // if email and password is valid, send request to login
      if (this.error.email === '' && this.error.password === '') {
        this.$store.dispatch('login', this.form)
          .then(() => this.$router.push({name: 'home'}))
             .catch(err => {
               this.invalid = true   
               this.form = {
                 email: '',
                 password: ''
               }   
          })
      }

    },
  },
}
</script>

